            "Su hijo puede unirse a la escuela a través del sistema educativo oficial, que incluye escuelas gubernamentales, privadas e internacionales supervisadas por el Ministerio de Educación. La educación gubernamental actualmente está disponible para refugiados y solicitantes de asilo sudaneses, sudaneses del sur, yemeníes y sirios en pie de igualdad con los egipcios, y la Comisión trabaja con el gobierno para integrar otras nacionalidades de refugiados también."),
        "learningA10": MessageLookupByLibrary.simpleMessage(
            "Sí, ACNUR proporciona becas educativas para solicitantes de asilo y refugiados en edad escolar inscritos en escuelas públicas, privadas y comunitarias en Egipto a través de su socio, la Caritas Egypt Relief Agency. Según criterios específicos establecidos por ACNUR y anunciados en junio de cada año, pueden ser elegibles para becas educativas."),
        "learningA11": MessageLookupByLibrary.simpleMessage(
            "ACNUR brinda apoyo a niños con necesidades especiales a través de su socio implementador, Caritas Egypt Relief Agency, que proporciona asesoramiento para evaluar las necesidades del niño y, si es necesario, puede brindar apoyo adicional como encontrar una escuela adecuada para ellos o proporcionar becas educativas adicionales."),
        "learningA12part1": MessageLookupByLibrary.simpleMessage(
            "La educación postsecundaria y superior comienza a los 18 años. En Egipto, la educación superior está actualmente disponible para refugiados sirios, yemeníes y sudaneses."),
        "learningA12part2": MessageLookupByLibrary.simpleMessage(
            "El Ministerio de Educación Superior determina las exenciones de tarifas universitarias según la nacionalidad y el tipo de certificado de secundaria. Las exenciones se renuevan anualmente."),
        "learningA13": MessageLookupByLibrary.simpleMessage(
            "No, ACNUR no ofrece becas para la educación universitaria. Sin embargo, el Fondo Alemán para la Iniciativa Académica Albert Einstein para Refugiados (DAFI) apoya a estudiantes matriculados en universidades gubernamentales. La información sobre el programa se anuncia temprano cuando se acepta una nueva cohorte."),
        "learningA14": MessageLookupByLibrary.simpleMessage(
            "Es una plataforma en línea gratuita que ofrece una variedad de cursos en varios campos, como negocios, marketing, idiomas, programación, etc., ofrecidos por universidades de renombre e instituciones en todo el mundo. Se emite un certificado al finalizar cada curso. Coursera for Refugees"),
        "learningA15": MessageLookupByLibrary.simpleMessage(
            "Los refugiados, solicitantes de asilo y egipcios con una dirección de correo electrónico y acceso a Internet pueden postularse, así como aquellos que pueden registrarse, completar la solicitud y terminar el programa en uno de los centros de aprendizaje comunitario en Maadi y Nasr City. La convocatoria está actualmente abierta para 200 jóvenes refugiados, solicitantes de asilo y egipcios de entre 18 y 35 años solamente, con prioridad para la inscripción."),
        "learningA16": MessageLookupByLibrary.simpleMessage(
            "Sí, algunos cursos están traducidos al árabe, pero los exámenes y la mayoría de los cursos se imparten en inglés."),
        "learningA17part1": MessageLookupByLibrary.simpleMessage(
            "El acceso a Internet solo es necesario para descargar el curso: una vez descargado, puedes completar el curso sin conexión. Dado que Coursera también tiene una aplicación, un teléfono móvil o una tableta son suficientes para asistir; no es necesario tener una computadora."),
        "learningA17part2": MessageLookupByLibrary.simpleMessage(
            "También puedes acceder a Internet a través de los centros de aprendizaje comunitario de ACNUR en cooperación con Tearfund en Maadi y Nasr City si eres seleccionado."),
        "learningA18": MessageLookupByLibrary.simpleMessage(
            "Simplemente completa el formulario de solicitud en este enlace y recibirás una llamada si eres seleccionado: https://qrgo.page.link/YftWz"),
        "learningA19part1": MessageLookupByLibrary.simpleMessage(
            "Centro de Aprendizaje Comunitario en Maadi: 01028411101"),
        "learningA19part2": MessageLookupByLibrary.simpleMessage(
            "Centro de Aprendizaje Comunitario en Nasr City: 01033680393"),
        "learningA2part1": MessageLookupByLibrary.simpleMessage(
            "El sistema educativo egipcio se divide en:"),
        "learningA2part2":
            MessageLookupByLibrary.simpleMessage("Educación preescolar"),
        "learningA2part3": MessageLookupByLibrary.simpleMessage(
            "Educación primaria (del primero al sexto grado)"),
        "learningA2part4": MessageLookupByLibrary.simpleMessage(
            "Educación preparatoria (del primero al tercer grado)"),
        "learningA2part5": MessageLookupByLibrary.simpleMessage(
            "Educación secundaria (del primero al tercer grado), que se divide en dos categorías:"),
        "learningA2part6": MessageLookupByLibrary.simpleMessage(
            "Secundaria general, que consta de tres años académicos"),
        "learningA2part7": MessageLookupByLibrary.simpleMessage(
            "Secundaria técnica, que varía de 3 a 5 años académicos."),
        "learningA2part8": MessageLookupByLibrary.simpleMessage(
            "Los estudiantes que aprueben con éxito los exámenes de secundaria de los tres años se graduarán y obtendrán un certificado de la escuela egipcia (Certificado de Educación Secundaria General)."),
        "learningA3": MessageLookupByLibrary.simpleMessage(
            "Debes dirigirte a la Oficina de Asuntos Estudiantiles en la Administración Educativa de tu área de residencia."),
        "learningA4part1": MessageLookupByLibrary.simpleMessage(
            "Permiso de residencia válido"),
        "learningA4part2": MessageLookupByLibrary.simpleMessage(
            "Certificado escolar reconocido previamente por la escuela a la que asistió tu hijo antes de llegar a Egipto"),
        "learningA4part3": MessageLookupByLibrary.simpleMessage(
            "Si no tienes ninguno de los documentos anteriores, tu hijo debe someterse a un examen de nivelación realizado por el Ministerio de Educación."),
        "learningA5part1": MessageLookupByLibrary.simpleMessage(
            "Los exámenes de nivelación son pruebas cortas que deben tomar los estudiantes que han recibido educación fuera de Egipto para determinar el grado al que serán inscritos en el sistema oficial de escuelas egipcias."),
        "learningA5part2": MessageLookupByLibrary.simpleMessage(
            "Los estudiantes deben dirigirse al Departamento de Asuntos Estudiantiles y Exámenes en la Administración Educativa de su área de residencia con un permiso de residencia válido. El departamento organizará los exámenes de nivelación."),
        "learningA5part3": MessageLookupByLibrary.simpleMessage(
            "Los exámenes de nivelación son gratuitos."),
        "learningA5part4": MessageLookupByLibrary.simpleMessage(
            "Los estudiantes exitosos que pasen el examen recibirán una carta de \'Wafedin\' que indica la edad del niño para su inscripción en la escuela. Esta carta ayuda a los niños a ser admitidos en las escuelas."),
        "learningA6": MessageLookupByLibrary.simpleMessage(
            "El certificado escolar no debe tener más de dos años de antigüedad. Debe presentarse a las autoridades educativas, quienes determinarán si se considera equivalente a los certificados escolares egipcios o no."),
        "learningA7": MessageLookupByLibrary.simpleMessage(
            "Las personas registradas en la Agencia de las Naciones Unidas para los Refugiados (ACNUR) que no pueden inscribir a sus hijos en las escuelas debido a la falta de alguno de los siguientes documentos: permiso de residencia, tarjeta de solicitante de asilo (tarjeta amarilla) o pasaportes: pueden obtener una carta sellada de la escuela que confirme la disponibilidad de un lugar para el estudiante. Con esta carta, dirígete al departamento educativo y que lo sellen. Luego, ve a la Dirección de Pasaportes e Inmigración en Abbasia, El Cairo. Allí, obtén un número que indique cuándo esperas obtener la residencia. Usa este número para preparar una copia de tu tarjeta de registro en ACNUR y una copia de la carta presentada por la escuela, y comunícate con el Ministerio para obtener una excepción hasta que se otorgue la residencia. Para evitar retrasos en el proceso de inscripción de tu hijo, completa los trámites de residencia lo antes posible."),
        "learningA8part1": MessageLookupByLibrary.simpleMessage(
            "Los niños pueden inscribirse en el primer grado de primaria en escuelas públicas o privadas hasta los nueve años, según su nacionalidad. Si el estudiante tiene más de nueve años, debe inscribirse en un curso de educación de adultos antes de la inscripción en la escuela. Después de completar con éxito el curso de educación de adultos y obtener un certificado de alfabetización para adultos, el estudiante será inscrito directamente en el primer año preparatorio a través del sistema de educación en el hogar (Manazil)."),
        "learningA8part2": MessageLookupByLibrary.simpleMessage(
            "El estudiante continuará estudiando a través del sistema de educación en el hogar, a menos que su edad le permita asistir regularmente a la escuela. En este caso, el estudiante será inscrito en una escuela pública según la disponibilidad de plazas."),
        "learningA9part1": MessageLookupByLibrary.simpleMessage(
            "Los estudiantes deben dirigirse al Departamento de Asuntos Estudiantiles en la Administración Educativa de su área de residencia con los siguientes documentos:"),
        "learningA9part2": MessageLookupByLibrary.simpleMessage(
            "Último certificado educativo o evidencia de haberlo aprobado."),
        "learningA9part3": MessageLookupByLibrary.simpleMessage(
            "Documentos/tarjetas de la Agencia de las Naciones Unidas para los Refugiados."),
        "learningA9part4":
            MessageLookupByLibrary.simpleMessage("Dos fotos de pasaporte."),
        "learningA9part5": MessageLookupByLibrary.simpleMessage(
            "El departamento los referirá a la escuela más cercana a su hogar, donde serán inscritos, pero estudiarán desde casa y tomarán exámenes de mitad de año y fin de año en la escuela."),
        "learningQ1": MessageLookupByLibrary.simpleMessage(
            "¿Cuáles son las opciones disponibles para inscribir a mi hijo en la escuela en Egipto?"),
        "learningQ10": MessageLookupByLibrary.simpleMessage(
            "¿La Comisión proporciona algún apoyo financiero para la educación?"),
