        "residence1": MessageLookupByLibrary.simpleMessage(
            "Para obtener o renovar un permiso de residencia, siga las siguientes instrucciones:"),
        "residence10": MessageLookupByLibrary.simpleMessage(
            "- Todas las tarjetas de registro de la comisión de asuntos de refugiados para los miembros de la familia y las personas a cargo registradas contigo en Egipto."),
        "residence12": MessageLookupByLibrary.simpleMessage(
            "- Pasaporte original de los miembros de la familia y las personas a cargo registradas contigo en Egipto."),
        "residence13": MessageLookupByLibrary.simpleMessage(
            "- Copias de cada documento de registro de la comisión y pasaporte/pasaportes."),
        "residence14": MessageLookupByLibrary.simpleMessage(
            "- El número de referencia que obtuviste de la oficina de la comisión."),
        "residence15": MessageLookupByLibrary.simpleMessage(
            "- Dos fotos de pasaporte. No es necesario fotos de personas a cargo a menos que tengan más de 12 años y tengan una tarjeta de identificación separada emitida por la comisión."),
        "residence16": MessageLookupByLibrary.simpleMessage(
            "¿Debo pagar alguna tarifa para obtener la tarjeta de residencia?"),
        "residence17": MessageLookupByLibrary.simpleMessage(
            "Sí, se te pedirá que pagues una tarifa de expedición de tarjeta de residencia de 100 libras egipcias + las tarifas administrativas del banco por cada miembro de la familia mayor de 12 años en el banco ubicado en el edificio al presentar tu solicitud a la unidad de residencia."),
        "residence18": MessageLookupByLibrary.simpleMessage(
            "¿Cómo puedo llegar a la Dirección de Migración y Pasaportes?"),
        "residence19": MessageLookupByLibrary.simpleMessage(
            "La sede de la Dirección está en la calle Ramses 417 en Abbasia y es fácilmente accesible en transporte público siguiendo las siguientes instrucciones:"),
        "residence2": MessageLookupByLibrary.simpleMessage(
            "Los refugiados y solicitantes de asilo que deben renovar o obtener sus tarjetas de la comisión que les fue asignada en las oficinas de la comisión y que hayan recibido mensajes de la comisión al respecto, deben obtener un número de referencia de residencia del Ministerio de Relaciones Exteriores durante su entrevista en las oficinas de la comisión y comunicarse directamente con la oficina de residencia en la Dirección General de Migración, Pasaportes y Nacionalidad en Abbasia en la fecha programada para ellos."),
        "residence20": MessageLookupByLibrary.simpleMessage(
            "Para refugiados residentes en el Gran Cairo:"),
        "residence21": MessageLookupByLibrary.simpleMessage(
            "Metro: La estación más cercana a la nueva sede es la estación de Abbasia (línea verde, línea Embaba - Aeropuerto). Después de salir de la estación de metro, la dirección estará a cinco minutos a pie."),
        "residence22": MessageLookupByLibrary.simpleMessage(
            "Para refugiados residentes en otras gobernaciones:"),
        "residence23": MessageLookupByLibrary.simpleMessage(
            "Estación de tren Ramses: Puedes tomar el tren / transporte público desde cualquier gobernación hasta la estación de Ramses. Cuando llegues a la estación, ve a la estación del metro Shahid y bájate en la estación de metro El Ataba, donde cambiarás a la línea verde del metro (Embaba - Aeropuerto) y bájate en la estación de Abbasia. Después de salir de la estación de metro, la dirección estará a cinco minutos a pie."),
        "residence3": MessageLookupByLibrary.simpleMessage(
            "Los refugiados y solicitantes de asilo con tarjetas válidas pueden obtener un número de referencia de residencia del Ministerio de Relaciones Exteriores y una cita para la presentación en las oficinas de Caritas Egipto en las siguientes direcciones:"),
        "residence4": MessageLookupByLibrary.simpleMessage(
            "- Octubre: propiedad 8/48 - Octava zona - Segunda vecindad diariamente excepto los sábados y domingos: de 8:30 a.m. a 3:30 p.m."),
        "residence5": MessageLookupByLibrary.simpleMessage(
            "- Nasr City: 30 Seboue El Masri Street, detrás de la policía de tráfico de Nasr City, diariamente excepto los sábados y domingos: de 8:30 a.m. a 3:30 p.m."),
        "residence6": MessageLookupByLibrary.simpleMessage(
            "- Alejandría: 26 Talat Numan Street, Raml Station, tercer piso, diariamente excepto los viernes y domingos: de 3:30 p.m. a 8:30 p.m."),
        "residence7": MessageLookupByLibrary.simpleMessage(
            "- Damietta: 81/21 First District, First Neighborhood, frente al Instituto de Turismo y Hotelería de New Damietta, diariamente excepto los viernes y sábados: de 2:30 p.m. a 7:30 p.m."),
        "residence8": MessageLookupByLibrary.simpleMessage(
            "Nota: Debe llevar su tarjeta válida cuando vaya a las oficinas de Caritas y asegúrese de que su tarjeta de comisión esté vigente por al menos un mes en la fecha programada frente a las oficinas de contacto de la Dirección General de Migración, Pasaportes y Nacionalidad en Abbasia."),
        "residence9": MessageLookupByLibrary.simpleMessage(
            "¿Qué documentos debo llevar?"),
        "restAndCafes":
            MessageLookupByLibrary.simpleMessage("Restaurantes y cafeterías"),
        "restuarants": MessageLookupByLibrary.simpleMessage("Restaurantes"),
        "rights": MessageLookupByLibrary.simpleMessage("Derechos"),
        "rightsA1": MessageLookupByLibrary.simpleMessage(
            "Los solicitantes de asilo y los refugiados tienen varios derechos porque solicitan el asilo o porque han obtenido protección como refugiados, los cuales el Estado anfitrión tiene la responsabilidad de garantizar. Estos derechos están estipulados en la Convención sobre los Refugiados y los tratados de derechos humanos. Estos derechos abordan la posibilidad de permanecer en el país anfitrión y no ser devuelto a su país de origen (no devolución, por ejemplo), educación, atención médica, vivienda, trabajo y familia, entre otros asuntos."),
        "rightsA2": MessageLookupByLibrary.simpleMessage(
            "Es lo que engloba el derecho internacional consuetudinario y los instrumentos internacionales que establecen los estándares necesarios para proteger a los refugiados. El Convenio de 1951 y su Protocolo de 1967 sobre el Estatuto de los Refugiados son fundamentales para la ley de asilo. El derecho internacional de asilo complementa tanto el derecho internacional de derechos humanos como el derecho internacional humanitario."),
        "rightsA3": MessageLookupByLibrary.simpleMessage(
            "Es un derecho importante para los refugiados, los solicitantes de asilo y otros que temen por sus vidas o libertades. Estas personas tienen el derecho de no ser expulsadas de ninguna manera por el país anfitrión a su país de origen, o a cualquier otro país donde puedan enfrentar peligro o daño. Este derecho, conocido como el principio de no devolución, está consagrado en la Convención sobre Refugiados y otros tratados de derechos humanos. También es parte de lo que se conoce como derecho internacional consuetudinario y, por lo tanto, debe ser garantizado por todos los países."),
        "rightsA4": MessageLookupByLibrary.simpleMessage(
            "La protección de los refugiados incluye todas las acciones destinadas a garantizar el pleno respeto de los derechos de los refugiados. Esto incluye proporcionar un entorno propicio para el respeto de la dignidad humana y prevenir o mitigar los efectos directos de un determinado patrón de abuso, y restaurar condiciones de vida dignas a través de compensación y rehabilitación."),
        "rightsA5": MessageLookupByLibrary.simpleMessage(
            "Sí, los refugiados tienen derechos humanos. Los derechos humanos en general se entienden como derechos inherentes e inalienables que una persona merece simplemente por ser humana. Están basados en los principios fundamentales de universalidad, igualdad y no discriminación, y están consagrados en tratados, normas de derecho internacional consuetudinario, leyes nacionales y otros estándares que los definen y ayudan a garantizar su pleno disfrute. Los derechos humanos se aplican a todas las personas, incluidas todas aquellas bajo la jurisdicción de ACNUR."),
        "rightsQ1": MessageLookupByLibrary.simpleMessage(
            "¿Cuáles son los derechos de los refugiados?"),
        "rightsQ2":
            MessageLookupByLibrary.simpleMessage("¿Qué es la ley de asilo?"),
        "rightsQ3": MessageLookupByLibrary.simpleMessage(
            "¿Qué es el principio de no devolución?"),
